import React from 'react';
import '../style.css'

const handleOwner = (shouldSeen) => {
    if(!shouldSeen){
        return(
            <div>Novruz Amirov</div>
        )
    }
    else{
        return ;
    }
}

class NovruzAmirov extends React.Component{
    render(){
        return(
            <div className='novruz'>
                {handleOwner(this.props.shouldSeen)}
            </div>
        )
    }
}

export default NovruzAmirov
